"use strict";(self.webpackChunkspanish_app=self.webpackChunkspanish_app||[]).push([[295],{4295:e=>{e.exports=JSON.parse('{"23":{"words":[{"spanish":"Yo estudio","english":"I study"},{"spanish":"T\xfa estudias","english":"You study"},{"spanish":"Ella estudia","english":"She studies"},{"spanish":"Nosotros estudiamos","english":"We study"},{"spanish":"Ellos estudian","english":"They study"},{"spanish":"Yo aprendo","english":"I learn"},{"spanish":"T\xfa aprendes","english":"You learn"},{"spanish":"\xc9l aprende","english":"He learns"},{"spanish":"Nosotros aprendemos","english":"We learn"},{"spanish":"Ellos aprenden","english":"They learn"},{"spanish":"Nosotros vamos","english":"We go"},{"spanish":"Ellos van","english":"They go"},{"spanish":"La escuela","english":"The school"},{"spanish":"La universidad","english":"The university"},{"spanish":"La clase","english":"The class"},{"spanish":"La tarea","english":"The homework"},{"spanish":"El examen","english":"The exam"},{"spanish":"La biblioteca","english":"The library"},{"spanish":"El profesor","english":"The teacher (male)"},{"spanish":"La profesora","english":"The teacher (female)"},{"spanish":"Dif\xedcil","english":"Difficult"},{"spanish":"F\xe1cil","english":"Easy"},{"spanish":"Interesante","english":"Interesting"},{"spanish":"Aburrido(a)","english":"Boring"},{"spanish":"Leer","english":"To read"},{"spanish":"Escribir","english":"To write"},{"spanish":"Escuchar","english":"To listen"},{"spanish":"Hablar","english":"To speak"},{"spanish":"Entender","english":"To understand"},{"spanish":"Repasar","english":"To review"},{"spanish":"El semestre","english":"The semester"},{"spanish":"La carrera","english":"The career (or major)"},{"spanish":"El libro de texto","english":"The textbook"},{"spanish":"La lecci\xf3n","english":"The lesson"},{"spanish":"La educaci\xf3n","english":"The education"}],"conversations":[{"id":1,"topic":"La universidad y los estudios","dialog":[{"speaker":"Ana","spanish":"\xbfQu\xe9 estudias en la universidad?","english":"What do you study at the university?"},{"speaker":"Luis","spanish":"Yo estudio ingenier\xeda. Es una carrera dif\xedcil, pero interesante.","english":"I study engineering. It\'s a difficult but interesting major."},{"speaker":"Ana","spanish":"Entiendo. Yo estudio literatura. Me gusta leer y escribir.","english":"I see. I study literature. I like to read and write."},{"speaker":"Luis","spanish":"Qu\xe9 bien. Mi hermano va a la misma universidad y \xe9l estudia historia.","english":"That\'s great. My brother goes to the same university and he studies history."}],"questions":[{"question":"\xbfQu\xe9 estudia Luis?","options":["Literatura","Historia","Ingenier\xeda","Ciencias"],"answer":"Ingenier\xeda","answerIndex":2},{"question":"\xbfQu\xe9 le gusta hacer a Ana?","options":["Estudiar historia","Escribir libros","Leer y escribir","Ir a la escuela"],"answer":"Leer y escribir","answerIndex":2},{"question":"\xbfQu\xe9 significa \'Es una carrera dif\xedcil\'?","options":["It is a difficult class","It is a difficult major","It is an easy job","It is a boring book"],"answer":"It is a difficult major","answerIndex":1}]},{"id":2,"topic":"La clase de espa\xf1ol","dialog":[{"speaker":"Sof\xeda","spanish":"La clase de espa\xf1ol es muy interesante. \xbfNo crees?","english":"Spanish class is very interesting. Don\'t you think?"},{"speaker":"Diego","spanish":"S\xed, lo es. La profesora es muy buena. Ella explica todo muy bien.","english":"Yes, it is. The teacher is very good. She explains everything very well."},{"speaker":"Sof\xeda","spanish":"Yo aprendo mucho en su clase. \xbfT\xfa entiendes todo?","english":"I learn a lot in her class. Do you understand everything?"},{"speaker":"Diego","spanish":"M\xe1s o menos. La gram\xe1tica es un poco dif\xedcil, pero yo repaso mis notas.","english":"More or less. The grammar is a little difficult, but I review my notes."}],"questions":[{"question":"\xbfQu\xe9 es un poco dif\xedcil para Diego?","options":["La clase","La profesora","La gram\xe1tica","Los libros"],"answer":"La gram\xe1tica","answerIndex":2},{"question":"\xbfC\xf3mo es la profesora?","options":["Aburrida","Mala","Buena","Triste"],"answer":"Buena","answerIndex":2},{"question":"\xbfQu\xe9 significa \'Ella explica todo muy bien\'?","options":["She learns everything very well","She understands everything very well","She explains everything very well","She writes everything very well"],"answer":"She explains everything very well","answerIndex":2}]},{"id":3,"topic":"La tarea y los ex\xe1menes","dialog":[{"speaker":"Clara","spanish":"Estoy en la biblioteca haciendo mi tarea. Es mucha.","english":"I am in the library doing my homework. It\'s a lot."},{"speaker":"David","spanish":"Yo tambi\xe9n. La tarea de matem\xe1ticas es muy larga. Yo no entiendo el \xfaltimo problema.","english":"Me too. The math homework is very long. I don\'t understand the last problem."},{"speaker":"Clara","spanish":"Yo te puedo ayudar. \xbfTienes un examen esta semana?","english":"I can help you. Do you have an exam this week?"},{"speaker":"David","spanish":"S\xed, yo voy a tener un examen el viernes. Yo tengo que estudiar mucho.","english":"Yes, I am going to have an exam on Friday. I have to study a lot."}],"questions":[{"question":"\xbfD\xf3nde est\xe1 Clara?","options":["En su casa","En la escuela","En la biblioteca","En la clase"],"answer":"En la biblioteca","answerIndex":2},{"question":"\xbfCu\xe1ndo tiene un examen David?","options":["Hoy","El viernes","Ma\xf1ana","La pr\xf3xima semana"],"answer":"El viernes","answerIndex":1},{"question":"\xbfQu\xe9 significa \'Yo no entiendo el \xfaltimo problema\'?","options":["I don\'t like the last problem","I don\'t have the last problem","I don\'t understand the last problem","I don\'t want the last problem"],"answer":"I don\'t understand the last problem","answerIndex":2}]},{"id":4,"topic":"Experiencias de aprendizaje","dialog":[{"speaker":"Pedro","spanish":"La educaci\xf3n es muy importante. Yo aprendo algo nuevo todos los d\xedas.","english":"Education is very important. I learn something new every day."},{"speaker":"Eva","spanish":"S\xed, yo tambi\xe9n. Me gusta leer sobre diferentes culturas. Es muy interesante.","english":"Yes, me too. I like to read about different cultures. It\'s very interesting."},{"speaker":"Pedro","spanish":"Yo prefiero aprender con videos. Mi cerebro aprende m\xe1s r\xe1pido as\xed.","english":"I prefer to learn with videos. My brain learns faster that way."},{"speaker":"Eva","spanish":"\xa1Qu\xe9 bien! Mi profesora dice que cada persona aprende de una manera diferente.","english":"That\'s great! My teacher says that each person learns in a different way."}],"questions":[{"question":"\xbfQu\xe9 es importante para Pedro y Eva?","options":["El trabajo","La educaci\xf3n","Los libros","Los videos"],"answer":"La educaci\xf3n","answerIndex":1},{"question":"\xbfC\xf3mo prefiere aprender Pedro?","options":["Con videos","Con libros","Con m\xfasica","Con la profesora"],"answer":"Con videos","answerIndex":0},{"question":"\xbfQu\xe9 significa \'cada persona aprende de una manera diferente\'?","options":["Each person likes a different thing","Each person learns in a different way","Each person goes to a different place","Each person has a different book"],"answer":"Each person learns in a different way","answerIndex":1}]}],"stories":[{"id":1,"title":"Mi Vida en la Escuela","sentences":[{"spanish":"Yo voy a la escuela todos los d\xedas. Mis clases son muy interesantes.","english":"I go to school every day. My classes are very interesting."},{"spanish":"Mi profesora de historia es muy buena. Ella nos ense\xf1a muchas cosas.","english":"My history teacher is very good. She teaches us many things."},{"spanish":"Yo estudio mucho para los ex\xe1menes. Siempre repaso mis notas en la biblioteca.","english":"I study a lot for exams. I always review my notes in the library."},{"spanish":"Mis amigos y yo siempre hacemos la tarea juntos. Nosotros nos ayudamos.","english":"My friends and I always do homework together. We help each other."},{"spanish":"A m\xed me gusta mucho la escuela. La educaci\xf3n es muy importante para mi futuro.","english":"I really like school. Education is very important for my future."}]},{"id":2,"title":"Un Semestre Dif\xedcil","sentences":[{"spanish":"Este semestre, yo estudio tres clases de matem\xe1ticas. Son muy dif\xedciles.","english":"This semester, I am studying three math classes. They are very difficult."},{"spanish":"La tarea es muy larga y los ex\xe1menes son muy complicados. Yo no entiendo todo.","english":"The homework is very long and the exams are very complicated. I don\'t understand everything."},{"spanish":"Mi amigo me ayuda. \xc9l es muy inteligente y \xe9l entiende todo.","english":"My friend helps me. He is very intelligent and he understands everything."},{"spanish":"\xc9l y yo vamos a la biblioteca juntos para repasar las lecciones.","english":"He and I go to the library together to review the lessons."},{"spanish":"Yo s\xe9 que voy a aprender mucho. La educaci\xf3n es un camino largo, pero yo voy a tener \xe9xito.","english":"I know I am going to learn a lot. Education is a long road, but I am going to succeed."}]},{"id":3,"title":"Un Sue\xf1o de Universidad","sentences":[{"spanish":"Yo siempre he querido ir a la universidad. Es mi sue\xf1o.","english":"I have always wanted to go to the university. It\'s my dream."},{"spanish":"Mis padres siempre me dicen que la educaci\xf3n es la llave para el \xe9xito.","english":"My parents always tell me that education is the key to success."},{"spanish":"Yo estudio mucho en la escuela. Mis clases favoritas son ciencias y literatura.","english":"I study a lot in school. My favorite classes are science and literature."},{"spanish":"Yo aprendo mucho sobre el mundo. Mis profesores son muy inspiradores.","english":"I learn a lot about the world. My teachers are very inspiring."},{"spanish":"Yo voy a ir a la universidad y voy a aprender todo lo que puedo.","english":"I am going to go to the university and I am going to learn everything I can."}]}],"speaking":{"title":"Hablando de la vida acad\xe9mica","description":"Preguntas y respuestas para practicar conversaciones sobre la escuela, la universidad y los estudios.","questions_and_answers":[{"question":{"spanish":"\xbfQu\xe9 estudias?","english":"What do you study?"},"answer":{"spanish":"Yo estudio espa\xf1ol.","english":"I study Spanish."}},{"question":{"spanish":"\xbfVas a la escuela o a la universidad?","english":"Do you go to school or university?"},"answer":{"spanish":"Yo voy a la universidad.","english":"I go to the university."}},{"question":{"spanish":"\xbfTienes mucha tarea?","english":"Do you have a lot of homework?"},"answer":{"spanish":"S\xed, tengo mucha tarea.","english":"Yes, I have a lot of homework."}},{"question":{"spanish":"\xbfC\xf3mo es tu profesora?","english":"What is your teacher like?"},"answer":{"spanish":"Ella es muy inteligente.","english":"She is very intelligent."}},{"question":{"spanish":"\xbfQu\xe9 aprendes en tu clase favorita?","english":"What do you learn in your favorite class?"},"answer":{"spanish":"Yo aprendo sobre la historia del mundo.","english":"I learn about world history."}},{"question":{"spanish":"\xbfTe gusta leer?","english":"Do you like to read?"},"answer":{"spanish":"S\xed, me gusta leer libros de ciencia ficci\xf3n.","english":"Yes, I like to read science fiction books."}},{"question":{"spanish":"\xbfD\xf3nde estudias normalmente?","english":"Where do you normally study?"},"answer":{"spanish":"Yo estudio en la biblioteca.","english":"I study in the library."}},{"question":{"spanish":"\xbfEs tu clase de matem\xe1ticas dif\xedcil?","english":"Is your math class difficult?"},"answer":{"spanish":"S\xed, es un poco dif\xedcil.","english":"Yes, it is a little difficult."}},{"question":{"spanish":"\xbfQu\xe9 vas a estudiar en el futuro?","english":"What are you going to study in the future?"},"answer":{"spanish":"Voy a estudiar medicina.","english":"I am going to study medicine."}},{"question":{"spanish":"\xbfQu\xe9 vas a hacer despu\xe9s de la clase?","english":"What are you going to do after class?"},"answer":{"spanish":"Voy a ir a mi casa a hacer la tarea.","english":"I am going to go home to do homework."}},{"question":{"spanish":"\xbfC\xf3mo es la educaci\xf3n en tu pa\xeds?","english":"What is education like in your country?"},"answer":{"spanish":"La educaci\xf3n es muy buena.","english":"Education is very good."}},{"question":{"spanish":"\xbfQu\xe9 aprenden los estudiantes en tu escuela?","english":"What do the students learn at your school?"},"answer":{"spanish":"Ellos aprenden ciencias y matem\xe1ticas.","english":"They learn science and math."}},{"question":{"spanish":"\xbfEntiendes todas las lecciones?","english":"Do you understand all the lessons?"},"answer":{"spanish":"S\xed, yo entiendo casi todo.","english":"Yes, I understand almost everything."}},{"question":{"spanish":"\xbfPor qu\xe9 es importante la educaci\xf3n?","english":"Why is education important?"},"answer":{"spanish":"Es la llave para tener un buen futuro.","english":"It is the key to having a good future."}},{"question":{"spanish":"\xbfCon qui\xe9n estudias?","english":"Who do you study with?"},"answer":{"spanish":"Yo estudio con mis amigos.","english":"I study with my friends."}},{"question":{"spanish":"\xbfCu\xe1ndo vas a repasar para el examen?","english":"When are you going to review for the exam?"},"answer":{"spanish":"Voy a repasar ma\xf1ana.","english":"I am going to review tomorrow."}},{"question":{"spanish":"\xbfQu\xe9 le\xedste en tu clase de literatura?","english":"What did you read in your literature class?"},"answer":{"spanish":"Le\xed un libro sobre un viaje.","english":"I read a book about a trip."}},{"question":{"spanish":"\xbfC\xf3mo es la tarea de historia?","english":"What is the history homework like?"},"answer":{"spanish":"La tarea es muy larga.","english":"The homework is very long."}},{"question":{"spanish":"\xbfQu\xe9 te gusta escuchar en clase?","english":"What do you like to listen to in class?"},"answer":{"spanish":"Me gusta escuchar al profesor y sus explicaciones.","english":"I like to listen to the teacher and his explanations."}},{"question":{"spanish":"\xbfQu\xe9 vas a aprender en el pr\xf3ximo semestre?","english":"What are you going to learn next semester?"},"answer":{"spanish":"Voy a aprender sobre el arte.","english":"I am going to learn about art."}}]}}}')}}]);